export class CorrecaoValor {
    constructor(data, curso, nomeAluno, numModulo, tipo, resposta, observacao, valor) {
        this.data = data;
        this.curso = curso;
        this.nomeAluno = nomeAluno;
        this.numModulo = numModulo;
        this.tipo = tipo;
        this.resposta = resposta;
        this.observacao = observacao;
        this.valor = valor;
    }
}
